import * as constants from '../common/constants.ts';

import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { NavMenuComponent } from './nav-menu/nav-menu.component';
import { HomeComponent } from './home/home.component';
import { CounterComponent } from './counter/counter.component';
import { FetchDataComponent } from './fetch-data/fetch-data.component';
import { ProductListComponent } from './product-list/product-list.component';
import { AddProductComponent } from './add-product/add-product.component';
import { PurchaseListComponent } from './purchase-list/purchase-list.component';
import { SaleListComponent } from './sale-list/sale-list.component';


@NgModule({
  declarations: [
    AppComponent,
    NavMenuComponent,
    HomeComponent,
    CounterComponent,
    FetchDataComponent,
    ProductListComponent,
    AddProductComponent,
    PurchaseListComponent,
    SaleListComponent,
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot([      
      { path: constants.PRODUCT_LIST_ROUTE, component: ProductListComponent, pathMatch: 'full' },
      { path: constants.PURCHASE_LIST_ROUTE, component: PurchaseListComponent },
      { path: constants.SALE_LIST_ROUTE, component: SaleListComponent },
      { path: constants.ADD_PRODUCT_ROUTE, component: AddProductComponent },
    ])
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
